import React from 'react';
import { createRoot } from 'react-dom/client';
import App from './App';

import Error from './Error';
import Root from './components/root/Root';
import Blog from './components/blog/Blog';

import { createBrowserRouter, RouterProvider } from 'react-router-dom';
import Price from './components/price/Price';
import About from './components/about/About';
import Contact from './components/contact/Contact';
import CreateShop from './components/shop/CreateShop';
import LoginShop from './components/shop/LoginShop';
import ShopRoot from './components/shop/ShopRoot';
import YourShop from './components/shop/YourShop';
import FormInfos from './components/shop/FormInfos';
import FormYourShop from './components/shop/FormYourShop';

const router = createBrowserRouter([
  {
    path: "/",
    element: <Root />,
    errorElement: <Error />,
    children: [
      {
        index: true,
        element: <App />
      },
      {
        path: "price",
        element: <Price />
      },
      {
        path: "blog",
        element: <Blog />
      },
      {
        path: "about",
        element: <About />
      },
      {
        path: "contact",
        element: <Contact />
      },
    ]
  },
  {
    path: "shop",
    element: <ShopRoot />,
    children: [
      {
        index: true,
        element: <YourShop />
      },
      {
        path: "login",
        element: <LoginShop />,
      },
      {
        path: "create-store",
        element: <CreateShop />,
        children: [
          {
            index: true,
            element: <FormInfos />
          },
          {
            path: "your-shop-information",
            element: <FormYourShop />
          },
        ]
      },
    ]
  },

])

const root = createRoot(document.getElementById('root'));
root.render(<RouterProvider router={router} />);
